import React from "react";
// SCSS
import "./teamInfo.scss";

const about = () => (
  <div className="team__info flex-center">
    <div>
      <h4 className="font20 weight800">Why do we play and why should you join?</h4>
      <p className="font12 weight500">
        Choose your side, capture, deploy, link and create fields.
      </p>
      <p className="font12 weight500"><a href= 'https://en.wikipedia.org/wiki/Ingress_(video_game)'>Read More</a></p>
    </div>
  </div>
);

export default about;
